import {v4 as uuidv4} from 'uuid'
import {ADD_Movie,EDIT_Movie,CHANGE_DONE}from "../Constants/Action-type"


const initialState = 
{movieList:[
  {
      id: uuidv4(),
      img: "https://fr.web.img6.acsta.net/pictures/23/11/08/16/46/0858591.jpg",
      title: "Noel Ã  candy cane Lane",
      isDone: true,
     },
    {
      id: uuidv4(),
      img: "data:image/jpeg;base64,",
      title: "Under the boardwalk",
      isDone: true,
    },
  {
       id: uuidv4(),
     img: "data:image/jpeg;base64,",
      title: "Le roi singe",
      isDone: true,
    },
    {
      id: uuidv4(),

       img: "data:image/jpeg;base64,",
      title: "Zootopie",
      isDone: false,
    },
    
  ]} 
function MovieReducer (state=initialState,action) {
    const {type,payload} = action ;

       switch (type) {
        case ADD_Movie: 
         return {
          movieList:[...state.movieList , payload]}
          case EDIT_Movie: 
          return {
            movieList: state.movieList.map((movie)=> movie.id === payload.id ? {...movie, title:payload.edit }:movie)
          }
          case CHANGE_DONE:
            return {
              movieList: state.movieList.map((movie) =>
          movie.id === payload ? { ...movie, isDone: !movie.isDone } : movie
        ),
            }
            // }
       
        default:
            return state
       }
       }
export default MovieReducer